static real_T proc_control_node_norm(const real_T x_data[], const int32_T
  *x_size)
{
  real_T absxk;
  real_T scale;
  real_T t;
  real_T y;
  int32_T b_k;
  int32_T kend;
  y = 0.0;
  if (*x_size == 1) {
    y = fabs(x_data[0]);
  } else {
    scale = 3.3121686421112381E-170;
    kend = *x_size - 1;
    for (b_k = 0; b_k <= kend; b_k++) {
      absxk = fabs(x_data[b_k]);
      if (absxk > scale) {
        t = scale / absxk;
        y = y * t * t + 1.0;
        scale = absxk;
      } else {
        t = absxk / scale;
        y += t * t;
      }
    }

    y = scale * sqrt(y);
  }

  return y;
}

