    proc_control_node_B.mu = a_data[b_j] / b_data[b_j];
    b_data[b_j + 1] -= proc_control_node_B.mu * c_data[b_j];
    x_data[b_j + 1] -= proc_control_node_B.mu * x_data[b_j];
